import logo from './logo.svg';
import './App.css';
import "./index.css";
import React from "react";
import Header from "./components/commons/layouts/header/header";
import Main from "./components/commons/layouts/main/main";
import Footer from "./components/commons/layouts/footer/footer";


function App() {
  return (
    <div className="App">
      <Header title="My header" subtitle="subtitle2" />
      <Main message="My content" />
      <Footer note="Footer Note232" />
      <Footer note="Footer Note2" />

    </div>
  );
}

export default App;
